"use strict";(self.webpackChunkrf_website=self.webpackChunkrf_website||[]).push([[9274],{51821:i=>{i.exports=JSON.parse('{"tag":{"label":"Risks","permalink":"/tags/Risks","allTagsPath":"/tags","count":18,"items":[{"id":"risks/Dependency-Risks/Agency-Risk/Agency-Risk","title":"Agency Risk","description":"Risks due to the fact that things you depend on have agency, and they have their own goals to pursue.","permalink":"/risks/Agency-Risk"},{"id":"risks/Communication-Risks/Communication-Risk","title":"Communication Risk","description":"Risk associated with getting messages heard and understood and the transfer of information.","permalink":"/risks/Communication-Risk"},{"id":"risks/Complexity-Risk/Complexity-Risk","title":"Complexity Risk","description":"Risks caused by the weight of complexity in the systems we create, and their resistance to change and comprehension.","permalink":"/risks/Complexity-Risk"},{"id":"risks/Coordination-Risk/Coordination-Risk","title":"Coordination Risk","description":"Risks due to the fact that systems contain multiple agents, which need to work together.","permalink":"/risks/Coordination-Risk"},{"id":"risks/Dependency-Risks/Deadline-Risk/Deadline-Risk","title":"Deadline Risk","description":"The risk of creating a dependency around a point in time.","permalink":"/risks/Deadline-Risk"},{"id":"risks/Feature-Risks/Feature-Fit-Risk","title":"Feature Fit Risk","description":"Risk that the needs of the client don\'t coincide with services provided by the supplier.","permalink":"/risks/Feature-Fit-Risk"},{"id":"risks/Dependency-Risks/Funding-Risk/Funding-Risk","title":"Funding Risk","description":"A particular dependency-scarcity risk, due to lack of funding.","permalink":"/risks/Funding-Risk"},{"id":"risks/Feature-Risks/Implementation-Risk","title":"Implementation Risk","description":"Risk that the functionality you are providing doesn\'t correctly implement the perceived solution you are trying to build for your clients.","permalink":"/risks/Implementation-Risk"},{"id":"risks/Internal-Model-Risk/Internal-Model-Risk","title":"Internal Model Risk","description":"Risks due to the differences between reality and an internal model of reality, and the assumption that they are equivalent.","permalink":"/risks/Internal-Model-Risk"},{"id":"risks/Environmental-Risks/Legal-Risk/Legal-Risk","title":"Legal Risk","description":"Risks due to the legal context in which an operation is running.","permalink":"/risks/Legal-Risk"},{"id":"risks/Dependency-Risks/Lock-In-Risk/Lock-In-Risk","title":"Lock-In Risk","description":"Risks due to the commitments we make around dependencies, and the limitations they place on our ability to change.","permalink":"/risks/Lock-In-Risk"},{"id":"risks/Feature-Risks/Market-Risk","title":"Market Risk","description":"Risk that the value your clients place on the features you supply will change, over time.","permalink":"/risks/Market-Risk"},{"id":"risks/Environmental-Risks/Operational-Risk/Operational-Risk","title":"Operational Risk","description":"The risk of loss resulting from inadequate or failed internal processes, people and systems or from external events.","permalink":"/risks/Operational-Risk"},{"id":"risks/Dependency-Risks/Process-Risk/Process-Risk","title":"Process Risk","description":"When you depend on a business process, human process or software process to give you something you need.","permalink":"/risks/Process-Risk"},{"id":"risks/Dependency-Risks/Reliability-Risk/Reliability-Risk","title":"Reliability Risk","description":"Risks of not getting benefit from a dependency due to it\'s reliability.","permalink":"/risks/Reliability-Risk"},{"id":"risks/Environmental-Risks/Reputational-Risk/Reputational-Risk","title":"Reputational Risk","description":"Reputational risk is the potential harm to reputation.","permalink":"/risks/Reputational-Risk"},{"id":"risks/Dependency-Risks/Schedule-Risk/Schedule-Risk","title":"Schedule Risk","description":"The aspect of dependency risk related to variance around the time taken to complete tasks on a schedule.","permalink":"/risks/Schedule-Risk"},{"id":"risks/Environmental-Risks/Security-Risk/Security-Risk","title":"Security Risk","description":"Risks due to hostile agents and events from inside or outside of the system.","permalink":"/risks/Security-Risk"}],"unlisted":false}}')}}]);